tos clubes que s&oacute; aparecem apenas uma vez por ano durante 4 meses, para disputar o campeonato estadual. N&atilde;o existe planejamento, atividades continuadas, objetivos e metas, o resultado &eacute; sempre o mesmo &ldquo;negativo&rdquo;, n&atilde;o h&aacute; evolu&ccedil;&atilde;o.</span></span></span></span></span></p></div></div></div></div></div></div></div></div></section><section id="comp-l9qxlbyy" class="comp-l9qxlbyy Lw0u6i"><div id="bgLayers_comp-l9qxlbyy" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-l9qxlbyy" class="VgO9Yg"></div></div><div class="dkukWC xnZvZH" data-testid="top-divider"><div style="--divider-layer-i:0" class="FRCqDF" data-testid="divider-layer-0"></div></div><div class="dkukWC MBOSCN" data-testid="bottom-divider"><div style="--divider-layer-i:0" class="FRCqDF" data-testid="divider-layer-0"></div></div><div data-testid="columns" class="So7Ias"><div id="comp-l9qxlc2g" class="comp-l9qxlc2g YzqVVZ"><div id="bgLayers_comp-l9qxlc2g" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-l9qxlc2g" class="VgO9Yg"></div></div><div data-mesh-id="comp-l9qxlc2ginlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-l9qxlc2ginlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-l9q1zqf2" class="tI1Qp6 comp-l9q1zqf2 wixui-box"><div class="xPEAfP" data-testid="container-bg"></div><div data-mesh-id="comp-l9q1zqf2inlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-l9q1zqf2inlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-l8dtzfje" class="KcpHeO tz5f0K comp-l8dtzfje wixui-text" data-testid="richTextElement"><h2 class="font_2" style="font-size:60px; line-height:normal;"><span class="color_11"><span style="font-size:60px;"><span style="font-family:dinneuzeitgroteskltw01-_812426,sans-serif;"><span style="letter-spacing:0.01em;">LEIS DE INCENTIVO</span></span></span></span></h2></div><div id="comp-l8dtzfjl" class="KcpHeO tz5f0K comp-l8dtzfjl wixui-text" data-testid="richTextElement"><p class="font_2" style="font-size:22px; line-height:1.3em; text-align:justify;"><span class="color_11"><span style="font-size:22px;"><span style="font-family:din-next-w01-light,din-next-w02-light,din-next-w10-light,sans-serif;"><span style="letter-spacing:0.01em;">O incentivo fiscal &eacute; um instrumento usado pelo governo para estimular atividades espec&iacute;ficas por prazo determinado e constitui-se em uma forma de empresas ou pessoas f&iacute;sica escolherem a destina&ccedil;&atilde;o de uma parte dos seus impostos que j&aacute; seriam pagos por ela, contribuindo, assim, para o desenvolvimento de projetos para sociedade.</span></span></span></span></p>

<p class="font_2" style="font-size:22px; line-height:1.3em; text-align:justify;"><span class="color_11"><span style="font-size:22px;"><span style="font-family:din-next-w01-light,din-next-w02-light,din-next-w10-light,sans-serif;"><span style="letter-spacing:0.01em;"><span class="wixGuard">​</span></span></span></span></span></p>

<p class="font_2" style="font-size:22px; line-height:1.3em; text-align:justify;"><span class="color_11"><span style="font-size:22px;"><span style="font-family:din-next-w01-light,din-next-w02-light,din-next-w10-light,sans-serif;"><span style="letter-spacing:0.01em;">Na pr&aacute;tica, o poder p&uacute;blico abre m&atilde;o de uma parte dos recursos que receberia, para incentivar a execu&ccedil;&atilde;o de iniciativas sociais, culturais, educacionais, de sa&uacute;de e esportivas, em benef&iacute;cio de v&aacute;rias pessoas. O investidor, por sua vez, apoia causas que poder&aacute; acompanhar de perto.</span></span></span></span></p></div><div id="comp-l9wxh39w" class="comp-l9wxh39w MazNVa"><div data-testid="linkElement" class="j7pOnl"><wow-image id="img_comp-l9wxh39w" class="HlRz5e BI8PVQ" data-image-info="{&quot;containerId&quot;:&quot;comp-l9wxh39w&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;targetWidth&quot;:447,&quot;targetHeight&quot;:340,&quot;isLQIP&quot;:true,&quot;imageData&quot;:{&quot;width&quot;:768,&quot;height&quot;:768,&quot;uri&quot;:&quot;53ab41_8d2cb324d8aa4c4b90fa3ec7fae2974c~mv2.png&quot;,&quot;name&quot;:&quot;cultura-idk.png&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;quality&quot;:{},&quot;crop&quot;:{&quot;x&quot;:0,&quot;y&quot;:88,&quot;width&quot;:768,&quot;height&quot;:584,&quot;svgId&quot;:&quot;909695c1e003409ba70b5561666c7c4d.svg&quot;}}}" data-bg-effect-name="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/53ab41_8d2cb324d8aa4c4b90fa3ec7fae2974c~mv2.png/v1/crop/x_0,y_88,w_768,h_584/fill/w_112,h_85,al_c,q_85,usm_0.66_1.00_0.01,blur_2,enc_auto/cultura-idk.png" alt="cultura-idk.png" style="width:100%;height:100%;object-fit:cover;object-position:50% 50%"/></wow-image></div></div></div></div></div></div></div></div></div></section><section id="comp-l9qbxrcx" class="comp-l9qbxrcx Lw0u6i"><div id="bgLayers_comp-l9qbxrcx" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbA