"letter-spacing:0.01em;">Leis estaduais que preveem a isen&ccedil;&atilde;o fiscal do Imposto Sobre Circula&ccedil;&atilde;o de Mercadoria e Servi&ccedil;os (ICMS), para o Incentivo a Projetos Culturais e Esportivos. Portanto, apenas as empresas contribuintes podem utilizar essa lei, o que leva &agrave; exclus&atilde;o de patroc&iacute;nios doados por pessoas f&iacute;sicas.</span></span></span></span></p>

<p class="font_2" style="font-size:22px; line-height:1.3em; text-align:justify;"><span class="color_11"><span style="font-size:22px;"><span style="font-family:din-next-w01-light,din-next-w02-light,din-next-w10-light,sans-serif;"><span style="letter-spacing:0.01em;"><span class="wixGuard">​</span></span></span></span></span></p>

<p class="font_2" style="font-size:22px; line-height:1.3em; text-align:justify;"><span class="color_11"><span style="font-size:22px;"><span style="font-family:din-next-w01-light,din-next-w02-light,din-next-w10-light,sans-serif;"><span style="letter-spacing:0.01em;">O benef&iacute;cio fiscal permite que o contribuinte patrocinador se credite de 100% do valor destinado ao patroc&iacute;nio de projetos devidamente credenciados, pela Secretaria da Cultura ou pela Secretaria de Esporte do seu estado.</span></span></span></span></p></div></div></div></div><div id="comp-l9iqe2y1" class="comp-l9iqe2y1 YzqVVZ"><div id="bgLayers_comp-l9iqe2y1" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-l9iqe2y1" class="VgO9Yg"></div></div><div data-mesh-id="comp-l9iqe2y1inlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-l9iqe2y1inlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-l9l7lzp6" class="hFQZVn comp-l9l7lzp6 wixui-box"><div class="nTiihL" data-testid="container-bg"></div><div data-mesh-id="comp-l9l7lzp6inlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-l9l7lzp6inlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-l9l7pk58" class="KcpHeO tz5f0K comp-l9l7pk58 wixui-text" data-testid="richTextElement"><h2 class="font_2" style="font-size:40px; line-height:normal; text-align:center;"><span class="color_11"><span style="font-size:40px;"><span style="font-family:dinneuzeitgroteskltw01-_812426,sans-serif;"><span style="letter-spacing:0.01em;">POSSIBILIDADES DE INCENTIVO ICMS</span></span></span></span></h2></div><div id="comp-l9q2939k" class="comp-l9q2939k SPY_vo"><div data-mesh-id="comp-l9q2939kinlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-l9q2939kinlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-l9l7azgv" class="comp-l9l7azgv wixui-vector-image"><div d